function Header() {
  return (
    <Card className="text-center"> {/* Use Card component */}
      <Card.Body>
        <h1 id="name">Divya</h1>
        <img
          src="data:image/png;base64,iVBORw0K..."
          alt="Your Image"
          className="img-fluid"
        />
      </Card.Body>
    </Card>
  );
}

export default Header;
